package com.narendra.narendra;

public class Sample {

    public static void main(String[] args) {
        System.out.println( getSwapTime(""));
        String input = "";
        int lastIndex = input.lastIndexOf('1');
        System.out.println("Last " +lastIndex);
    }

    public static int getSwapTime(String color) {
        // Write your code here

        int result = -1;
        for(int j =0 ; j < color.length() ; j++){
            if(color.charAt(j) == '0'){
                result = j;
                break;
            }
        }
        return result !=-1?(color.length() - result -2):0 ;
    }


}
